import './App.css';
import Navibar from "./componetns/navbar";
import {Route, Routes} from "react-router-dom";
import {home} from '../src/pages/Home'






function App() {
  return (
    <>
      <header>
          <a href="/">Home</a>
          <a href="/iphone">IPhone</a>
          <a href="/ipad">IPad</a>
      </header>
        <Routes>
            <Route path="/" element={<home/>} />
        </Routes>
    </>
  );
}

export default App;
